import React from "react";
import ReactDOM from "react-dom";
import profileImg from "./images/profile.jpg";
import post1Img from "./images/post1.jpg";
import post2Img from "./images/post2.jpg";
import post3Img from "./images/post3.jpg";
import dvagoImg from "./images/dvago.png";
import "./index.css";

function Header({ name }) {
  return (
    <div>
      <h2 class="heading"> {name} </h2>
    </div>
  );
}
function Form({ picss, input }) {
  return (
    <div className="formbox">
      <img
        className="picss"
        src="https://static.remove.bg/remove-bg-web/37843dee2531e43723b012aa78be4b91cc211fef/assets/start-1abfb4fe2980eabfbbaaa4365a0692539f7cd2725f324f904565a9a744f8e214.jpg"
        alt="new"
      />

      <input
        className="textarea"
        type="textarea"
        placeholder="What's on your mind"
      />
    </div>
  );
}

function Hi({ lipo, name, date, text, zero, like, comment, share }) {
  return (
    <div className="content">
      <div className="body">
        <div className="head">
          <img
            className="picssImg"
            src="https://static.remove.bg/remove-bg-web/37843dee2531e43723b012aa78be4b91cc211fef/assets/start-1abfb4fe2980eabfbbaaa4365a0692539f7cd2725f324f904565a9a744f8e214.jpg"
            alt="new"
          />
          <span className="pname">
            <p className="name">{name} </p> {date}{" "}
          </span>
        </div>
        <p className="text">{text} </p>

        <img
          className="zero"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ4Jw2cJRnIjTQwOVpryhFuBsc1WmqjSi2IqA&usqp=CAU"
          alt="new"
        />
        <p className="reaction">
          {" "}
          {like} {comment} {share}{" "}
        </p>
        <p className="buttons">
          <button>Like</button> <button>Comment</button> <button>Share </button>
        </p>
      </div>
    </div>
  );
}

ReactDOM.render(
  <>
    <Header name="facebook" />
    <Form zero={zero} />
    <Hi
      zero={zero}
      name="Dvago"
      date={"sponsered"}
      text="All the healthcare you need, delivered to you only in 60 minutes! 
  Download the App now"
      picss={picss}
      like={"1k likes"}
      comment={"150 comments"}
      share={"200 shares"}
    />
    <Hi
      picss={picss}
      name="ATif MEmon"
      date={"yesterday at 11:00a.m"}
      text="Give yourself sometime and think about it!"
      lipo={lipo}
      like={"41 likes"}
      comment={"3 comments"}
      share={"2 shares"}
    />
    <Hi
      zero={zero}
      name="ATif MEmon"
      date={"2 days ago"}
      text="InshaAllah"
      picss={picss}
      like={"10 likes"}
      comment={"2 comments"}
      share={"1 share"}
    />
  </>,

  document.querySelector("#root")
);
